alter table zz_import_20101016_patient add practiceID int
alter table zz_import_20101016_patient add patientId int
alter table zz_import_20101016_patient add rowId int identity(1,1)

alter table zz_import_20101016_patient add PrimaryInsurancePlanId int
alter table zz_import_20101016_patient add SecondaryInsurancePlanId int


update z
set practiceID=p.practiceId
from zz_import_20101016_patient z
	inner join practice p
		on p.name=z.[practice Name]
		
		
select *
into zz_import_20101016_patient_delete
from zz_import_20101016_patient
where rowId in (
				select max(rowId) as rowId
				from zz_import_20101016_patient
				group by [patient record id]
				having count(*) > 1
				)
				

delete z
from zz_import_20101016_patient_delete d
	inner join zz_import_20101016_patient z
		on z.rowId=d.rowId




update zz_import_20101016_patient
set Patient_HPhone = null
where Patient_HPhone = ''

update zz_import_20101016_patient
set Patient_WPhone = null
where Patient_WPhone = ''




