declare @practiceID int, @vendorImportID int
select @practiceID=1, @vendorImportID=1



	INSERT INTO [dbo].[Patient](
		prefix,
		Suffix,
		MiddleName,
		[PracticeID],
		[FirstName],
		[LastName],
		[AddressLine1],
		[AddressLine2],
		[City],
		[State],
		[ZipCode],
		[HomePhone],
		WorkPhone,
		WorkPhoneExt,
		MobilePhone,
		[DOB],
		SSN,
		[Gender],
		[VendorID],
		MedicalRecordNumber,
		VendorImportID,
		CollectionCategoryID,
		DefaultServiceLocationID,
		PrimaryProviderID,
		EmailAddress,
		EmploymentStatus,
		EmployerID,
		MaritalStatus
			
		,ResponsibleFirstName,
		ResponsibleMiddleName,
		ResponsibleLastName,
		ResponsibleAddressLine1,
		ResponsibleCity,
		ResponsibleState,
		ResponsibleZipCode
		)

	SELECT 
		'' prefix,
		left( '', 16) as suffix,
		left(isnull( Patient_MI, ''), 64) as MI,
		practiceID as practiceID,
		isnull( left( Patient_First, 64) , ''),
		isnull( left(Patient_Last, 64) , ''),
		isnull( left( Patient_Address1, 256), ''),
		isnull( left( Patient_Address2, 256), '') as addr2,
		left( isnull(Patient_City, ''), 128) ,
		case when len( ltrim(rtrim( Patient_State )) )=2 then ltrim(rtrim( Patient_State )) else '' end,
		left(replace( Patient_Zip,'-', ''), 9) as zip,
		cast( replace(replace(replace(replace( Patient_HPhone, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) HomePhone,
		cast( replace(replace(replace(replace( Patient_WPhone, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) WorkPhone,
		null workExt,
		null as MobilePhone, 
		cast( case when isdate( Patient_DOB )=1 then Patient_DOB else null end as datetime) as Patient_DOB,
		case when len(replace( null, '-', ''))=9 then replace( null , '-', '') else null end as SSN,
		case Patient_Gender
			when '1' then 'M'
			when '2' then 'F'
			else null end,  
		rowid as [VendorID], -- vendorID
		left( nullif( [Patient Record Id], ''), 128)  as  MRN,
		@vendorImportID, -- vendorImportID
		1,
		null as serviceLocationID,
		null as primaryProviderID,
		left( null, 256) as Email,
		null as EmploymentStatus,
		null EmployerID,
		null as MaritalStatus
		
		,isnull( null, '') as ResponsibleFirstName,
		null as ResponsibleMiddleName,
		isnull( null, '') as ResponsibleLastName,
		left( isnull( null, ''), 256) as ResponsibleAddressLine1,
		isnull( null, '') as ResponsibleCity,
		rtrim(ltrim( isnull( null, '') )) as ResponsibleState,
		isnull( left(replace(  null,'-', ''), 9), '') as ResponsibleZipCode
	from dbo.zz_import_20101016_patient i
	where not exists(select * from patient p where p.vendorID=i.rowID and p.vendorImportID=@vendorImportID)



update z
set patientId=p.patientId
from zz_import_20101016_patient z
	inner join patient p
		on p.vendorId=z.rowID



update p
set ResponsibleFirstName = FinancialResponsibility_First,
	ResponsibleLastName = PatientResponsibility_Last
from zz_import_20101016_patient z
	inner join patient p
		on p.vendorId=z.rowID
where vendorImportId=1



