update insuranceCompany
set vendorId=replace( cast(notes as varchar(max)), 'Kareo import on 10/16/2010, rowid:', ''),
	vendorImportId=1


update insuranceCompany
set vendorImportId=1
where  cast(notes as varchar(max)) like 'Kareo import on 10/16/2010, rowid:%'



update ic
set Notes = 'Kareo import on 10/16/2010, PlanCode = ' + cast([INSURANCE PLAN CODE] as varchar(max))
from insuranceCompany ic
	inner join dbo.zz_import_20101016_insurance i
		on i.rowId=ic.vendorId
where vendorImportId=1


update z
set insuranceCompanyId = ic.insuranceCompanyId
from dbo.zz_import_20101016_insurance z
	inner join insuranceCompany ic
		on ic.vendorId=z.rowId
where ic.vendorImportId=1









-- Primry
select distinct 
	'exec InsurancePlanDataProvider_CreateInsurancePlan 
		@name = ''' + replace( isnull( [PLAN NAME], ''), '''', '''''') + ''',
		@street_1 = ''' + isnull( replace( [PLAN ADDRESS 1], '''', '''''') , '') + ''',
		@street_2 = ''' + isnull( [PLAN ADDRESS 2], '') + ''',
		@city =''' + isnull( [PLAN CITY], '') + ''',
		@state = ''' + isnull( [PLAN STATE], '') + ''',
		@zip = ''' + isnull(cast( isnull( [PLAN ZIP], '') as varchar(32)), '')+ '''
		
		,@program_code=N''CI''
		,@deductible=''' + cast( isnull(null, 0) as varchar(32)) + '''
