update zp
set PrimaryInsurancePlanId=zi.InsuranceCompanyPlanId
from dbo.zz_import_20101016_patient zp
	inner join dbo.zz_import_20101016_insurance zi
		on zp.[INSURANCE PLAN COE]=zi.[INSURANCE PLAN CODE]

		
update zp
set SecondaryInsurancePlanId=zi.InsuranceCompanyPlanId
from dbo.zz_import_20101016_patient zp
	inner join dbo.zz_import_20101016_insurance zi
		on zp.[SECONDARY INSURANCE PLAN CODE]=zi.[INSURANCE PLAN CODE]


	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		patientID,	
		'Default Insurance Case',
		1,
		5,
		951,
		951,
		practiceID,
		VendorImportID,
		p.vendorID
	from Patient p
	where p.VendorImportID = @vendorImportId
		and vendorId in ( select rowId from dbo.zz_import_20101016_patient i where PrimaryInsurancePlanId is not null or SecondaryInsurancePlanId is not null
							)


	insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
	,CoPay

	,HolderLastName
	,HolderFirstName
	,HolderMiddleName
	,HolderAddressLine1
	,HolderAddressLine2
	,HolderCity
	,HolderState
	,HolderZipCode
	,HolderDOB
	,HolderGender
	,HolderPhone
	)
select 
	pc.PatientCaseID
	,z.PrimaryInsurancePlanId
	,1 as precedence
	,nullif(Insurance_IDNO, '') as Policy
	,nullif(Insurance_GroupNo, '') as [Group]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,z.rowID as VendorID
	,p.vendorImportId as VendorImportID
	,p.PracticeID
	, 0 as copay
	
	,Insured_Last
	,Insured_First
	,Insured_Middle
	,Insured_Address1
	,Insured_Address2
	,Insured_City
	,Insured_State
	,replace(Insured_Zip, '-', '')
	,Insured_DOB
	,case Insured_Gender when 1 then 'M' when 2 then 'F' else null end
	,cast( replace(replace(replace(replace( Insured_Phone, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) HomePhone
from Patient p
	inner join dbo.zz_import_20101016_patient z
		on z.rowId=p.vendorId
	inner join PatientCase pc (nolock)
		on pc.patientID=p.patientID
where p.vendorImportID=@vendorImportId
	and z.PrimaryInsurancePlanId is not null



insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
	,CoPay

	,HolderLastName
	,HolderFirstName
	,HolderMiddleName
	,HolderDOB
	,HolderGender
	)
select 
	pc.PatientCaseID
	,z.SecondaryInsurancePlanId
	,2 as precedence
	,nullif(SecondaryInsured_IDNO, '') as Policy
	,nullif(SecondaryInsured_GroupNo, '') as [Group]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,z.rowID as VendorID
	,p.vendorImportId as VendorImportID
	,p.PracticeID
	, 0 as copay
	
	,SecondaryInsured_Last
	,SecondaryInsured_First
	,SecondaryInsured_Middle
	,SecondaryInsured_DOB
	,case SecondaryInsured_Gender when 1 then 'M' when 2 then 'F' else null end
from Patient p
	inner join dbo.zz_import_20101016_patient z
		on z.rowId=p.vendorId
	inner join PatientCase pc (nolock)
		on pc.patientID=p.patientID
where p.vendorImportID=@vendorImportId
	and z.SecondaryInsurancePlanId is not null





