declare @vendorImportId int
set @vendorImportId=1


INSERT INTO [dbo].[Doctor]
           ([PracticeID]
           ,[Prefix]
           ,[FirstName]
           ,[MiddleName]
           ,[LastName]
           ,[Suffix]
           ,[SSN]
           ,[AddressLine1]
           ,[AddressLine2]
           ,[City]
           ,[State]
           ,[Country]
           ,[ZipCode]
           ,[Notes]
           ,[ActiveDoctor]
           ,[TaxonomyCode]
           ,[DepartmentID]
           ,[VendorID]
           ,[VendorImportID]
           ,[FaxNumber]
           ,[FaxNumberExt]
           ,[OrigReferringPhysicianID]
           ,[External]
           ,[NPI]
           ,[ProviderTypeID]
           ,[ProviderPerformanceReportActive]
           ,[ProviderPerformanceScope]
           ,[ProviderPerformanceFrequency]
           ,[ProviderPerformanceDelay]
           ,[ProviderPerformanceCarbonCopyEmailRecipients]
           ,Degree
           ,WorkPhone
     )
     
select
			[PracticeID]
           ,'' as [Prefix]
           ,left([Provider_First], 64) as FirstName
           , left( isnull( [Provider_MI], ''), 64) as [MiddleName]
           ,left( rtrim(ltrim(isnull(Provider_Last,'') )), 64) as [LastName]
           ,isnull(Provider_Suffix, '') as [Suffix]
           ,replace(Provider_ssn, '-', '') as ssn
           ,left(Provider_Address1, 256) as [AddressLine1]
           ,left(Provider_Address2, 256) as [AddressLine2]
           ,left(Provider_city, 128) as [City]
           ,left(Provider_state, 2) as [State]
           ,'' as [Country]
           ,replace(Provider_zip, '-', '') as [ZipCode]
           ,'Imported by Kareo 10/16/2010' as [Notes]
           ,1 as [ActiveDoctor]
           ,'0000000001' as [TaxonomyCode]
           ,null [DepartmentID]
           ,rowID as [VendorID]
           ,@vendorImportId as [VendorImportID]
           ,null [FaxNumber]
           ,null [FaxNumberExt]
           ,null [OrigReferringPhysicianID]
           ,0 as [External]
           ,[Provider_Rendering NPI] as [NPI]
           ,1 as [ProviderTypeID]
           ,1 as [ProviderPerformanceReportActive]
           ,1 as [ProviderPerformanceScope]
           ,'D' [ProviderPerformanceFrequency]
           ,2 [ProviderPerformanceDelay]
           ,null [ProviderPerformanceCarbonCopyEmailRecipients]
           ,ltrim(rtrim( LEFT('', 8) ))
			,cast( replace(replace(replace(replace( Provider_Phone, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) HomePhone
	
from zz_import_20101016_provider z
where not exists( select * from doctor d where d.vendorID=z.rowID and d.vendorImportID=@vendorImportId)



update d
set notes = cast(notes as varchar(max)) + ', TaxId: ' + isnull(provider_taxId, '')
from doctor d
	inner join zz_import_20101016_provider z
		on z.rowId=d.vendorId
where d.vendorImportId=1
